【H-439】PIAA ピア LEDバルブ<br>TERA フォグ LED(for Fog Lamp)<br>純正フォグランプ用LED　H8/H11タイプ ホワイト　H-439<br>
フォグランプをLEDにするスタイル<br><br>
手軽にハロゲンフォグをLEDに。<br>
圧倒的な輝きを実現した純正フォグランプ用LED交換タイプ。<br>
※LEDデイタイムバルブは照射を目的とするものではなく、車両の存在を目立たせることで事故の減少を促すデイタイムランプとして、光源の美しさを主張する商品です。<br>
また、ヘッドライトに取り付けた場合や、ヘッドライトと一体のフォグランプに取り付けた場合には、保安基準に適合しません。<br>
絶対に取り付けしないでください。<style type="text/css">
