【特長】<br>信頼度が高いアメリカCREE社製LEDチップを使用し、高輝度な輝きが長時間安定して発行します。<br><br>光源の束をコントロールする配光シェードを採用する事により、車輌装着時にカットラインがキレイにでます。<br><br>アルミヒートシンク冷却ファン内装! 放熱効果でLEDの熱劣化を軽減し、クルマに優しく長寿命を実現<br><br>オールインワンキットで取付け簡単<br><br>High/Lowの切り替え対応タイプ<br><br>樹脂レンズ車にも取付可能<br><br>12V車専用<br>ヘッドランプ用<br>光量:3600lm 色温度:6000k<br>口金:H4<br>ホワイト光<br><br>【メーカー】<br>アークス<br><br>【品番】<br>GRX-50<br><style type="text/css">
